import * as React from 'react';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import Box from '@mui/material/Box';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import PeopleIcon from '@mui/icons-material/People';
import DnsRoundedIcon from '@mui/icons-material/DnsRounded';
import PermMediaOutlinedIcon from '@mui/icons-material/PhotoSizeSelectActual';
import PublicIcon from '@mui/icons-material/Public';
import SettingsEthernetIcon from '@mui/icons-material/SettingsEthernet';
import SettingsInputComponentIcon from '@mui/icons-material/SettingsInputComponent';
import TimerIcon from '@mui/icons-material/Timer';
import SettingsIcon from '@mui/icons-material/Settings';
import PhonelinkSetupIcon from '@mui/icons-material/PhonelinkSetup';
import Button from '@mui/material/Button';
import Settings from '@mui/icons-material/Settings';
import IconButton from '@mui/material/IconButton';  // Asegúrate de incluir esta importación
import MailIcon from '@mui/icons-material/Mail'; // Agregado para el icono de correo
import PhotoIcon from '@mui/icons-material/Photo';
import Avatar from '@mui/material/Avatar';


import { Edit } from '@mui/icons-material';


const categories = [
  {
    children: [
      { id: 'Authentication', icon: <PeopleIcon /> },
      { id: 'Database', icon: <DnsRoundedIcon /> },
      { id: 'Storage', icon: <PermMediaOutlinedIcon /> },
      { id: 'Hosting', icon: <PublicIcon /> },
      { id: 'Functions', icon: <SettingsEthernetIcon /> },
      { id: 'Machine learning', icon: <SettingsInputComponentIcon /> },
    ],
  },
  {
    id: 'Quality',
    children: [
      { id: 'Analytics', icon: <SettingsIcon /> },
      { id: 'Performance', icon: <TimerIcon /> },
      { id: 'Test Lab', icon: <PhonelinkSetupIcon /> },
    ],
  },
];

const item = {
  py: '2px',
  px: 3,
  color: 'rgba(255, 255, 255, 0.7)',
  '&:hover, &:focus': {
    bgcolor: 'rgba(255, 255, 255, 0.08)',
  },
};

const itemCategory = {
  boxShadow: '0 -1px 0 rgb(255,255,255,0.1) inset',
  py: 1.5,
  px: 3,
};

export default function Navigator(props) {
  const { ...other } = props;

  return (
    <Drawer variant="permanent" {...other} sx={{ height: '100%' }}>
      <List disablePadding sx={{ bgcolor: ' #344955 ', height: '100%' }}>



      <ListItem sx={{ ...item, ...itemCategory, fontSize: 22, color: '#fff', justifyContent: 'flex-end' }}>


      <ListItemIcon>
            <Avatar
              alt="Nelson"
              src="https://example.com/images/gmail.svg"
            />
          </ListItemIcon>

          <ListItemIcon>
            <IconButton color="inherit">
              <SettingsIcon />
            </IconButton>
          </ListItemIcon>
        </ListItem>
        
        <ListItem sx={{ ...item, ...itemCategory }}>
         
        <Button
            variant="outlined"
            sx={{
              borderRadius: '25px',
              color: '#0f1312',
              bgcolor: '#FFA500',
              typography: {
                fontFamily: 'Libre Franklin',
                fontWeight: 'bold', // Puedes ajustar el peso según sea necesario
                fontSize: '15px',
                letterSpacing: '0.15px',
              },
            }}
          >
            <ListItemIcon>
              <Edit/>
            </ListItemIcon>
            COMPOSE
          </Button>
        </ListItem>
        {categories.map(({ id, children }) => (
          <Box key={id} sx={{ bgcolor: ' #344955 ' }}>
            <ListItem sx={{ py: 2, px: 3 }}>
              <ListItemText sx={{ color: '#fff' }}>{id}</ListItemText>
            </ListItem>
            {children.map(({ id: childId, icon, active }) => (
              <ListItem disablePadding key={childId}>
                <ListItemButton selected={active} sx={item}>
                  <ListItemIcon>{icon}</ListItemIcon>
                  <ListItemText>{childId}</ListItemText>
                </ListItemButton>
              </ListItem>
            ))}
            <Divider sx={{ mt: 2 }} />
          </Box>
        ))}
      </List>
    </Drawer>
  );
}
